import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the Electronics category card
    const electronicsCardLocator = page.locator('div.category-card:has-text("Electronics")');
    await electronicsCardLocator.waitFor({ state: 'visible', timeout: 5000 });
    await electronicsCardLocator.click();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_click.png'));

    // Verify navigation by checking for the category title
    const categoryTitleLocator = page.locator('div.category-results h2');
    await categoryTitleLocator.waitFor({ state: 'visible', timeout: 5000 });

    const categoryTitle = await categoryTitleLocator.innerText();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_verification.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_verification.png'));

    return {
      success: true,
      action: "Navigated to Electronics Category",
      extractedData: {
        categoryTitle: categoryTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Electronics Category",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
